import {
  all,
  call,
  fork,
  put,
  takeEvery,
  takeLatest,
} from 'redux-saga/effects';

export default function* rootSaga() {
  yield all([
    fork(watchLogIn), // call과 다름 (call은 비동기 실행)
    fork(watchLogOut),
    fork(watchAddPost),
  ]);
}
